// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IPGCApproval {
    function approve(bytes32 productHash) external;
    function isApproved(bytes32 productHash) external view returns (bool);
}

interface IThirdPartyApproval {
    function approve(bytes32 productHash) external;
    function isApproved(bytes32 productHash) external view returns (bool);
}

contract CertificationIssuer {
    struct Product {
        string name;
        string origin;
        string produceDate;
        string farmerName;
        bool certified;
        uint256 certificateId;
    }

    address public owner;
    address public pgcContract;
    address public thirdPartyContract;
    uint256 public certificateCounter;

    mapping(bytes32 => Product) public productRequests;
    mapping(uint256 => Product) public certificates;

    event ProductSubmitted(bytes32 productHash, string name);
    event CertificateIssued(uint256 certId, bytes32 productHash);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not authorized");
        _;
    }

    constructor(address _pgc, address _thirdParty) {
        owner = msg.sender;
        pgcContract = _pgc;
        thirdPartyContract = _thirdParty;
    }

    function submitProduct(
        string memory _name,
        string memory _origin,
        string memory _produceDate,
        string memory _farmerName
    ) public onlyOwner {
        bytes32 productHash = keccak256(
            abi.encodePacked(_name, _origin, _produceDate, _farmerName)
        );

        require(bytes(productRequests[productHash].name).length == 0, "Already exists");

        productRequests[productHash] = Product({
            name: _name,
            origin: _origin,
            produceDate: _produceDate,
            farmerName: _farmerName,
            certified: false,
            certificateId: 0
        });

        emit ProductSubmitted(productHash, _name);
    }

    function issueCertificate(bytes32 productHash) public onlyOwner {
        require(IPGCApproval(pgcContract).isApproved(productHash), "PGC not approved");
        require(IThirdPartyApproval(thirdPartyContract).isApproved(productHash), "Third party not approved");

        Product storage product = productRequests[productHash];
        require(!product.certified, "Already certified");

        certificateCounter++;
        product.certified = true;
        product.certificateId = certificateCounter;
        certificates[certificateCounter] = product;

        emit CertificateIssued(certificateCounter, productHash);
    }

    function getCertificate(uint256 id) public view returns (Product memory) {
        return certificates[id];
    }
}

